    "DEPRECATED - This is now stored in the LtiConfiguration model.": "\u05de\u05d1\u05d5\u05d8\u05dc - \u05d6\u05d4 \u05de\u05d0\u05d5\u05d7\u05e1\u05df \u05db\u05e2\u05ea \u05d1\u05de\u05d5\u05d3\u05dc LtiConfiguration.",
